import React, { useEffect } from "react";

const App = () => {
  useEffect(() => {
    let data = [
      {
        pseudo: "Moussa",
        age: 30,
        techno: ["Javascript", " nodeJs", "Pythion"],
        admin: true
      },
      {
        pseudo: "Yass",
        age: 18,
        techno: ["Php", " nodeJs", "Pythion"],
        admin: false
      },
      {
        pseudo: "Nicola",
        age: 70,
        techno: ["Ruby", " nodeJs", "Pythion"],
        admin: true
      },
      {
        pseudo: "Isaac",
        age: 17,
        techno: ["C++", " Java", "Pythion"],
        admin: false
      }
    ];

    window.addEventListener("click", e => {
      console.log(e.target);
    });
  });
  return (
    <>
      <h1>Body</h1>
    </>
  );
};

export default App;
